    def encontrar_combinacion(ancho, alto, rangos):
     print(f"Buscando combinación para ancho: {ancho}, alto: {alto}")  # Para depuración

    for rango in rangos:
        print(f"Evaluando rango: ancho_max={rango['ancho_max']}, alto_max={rango['alto_max']}")  # Para depuración

        if ancho <= rango['ancho_max'] and alto <= rango['alto_max']:
            paneles = rango['resultado']['paneles']
            paneles_sug = rango['resultado'].get('paneles_sug', {})  # Uso de .get() para evitar KeyError
            herraje = rango['resultado']['herraje']
            descripcion_paneles = " y ".join([f"{cantidad} paneles de {medida}" for medida, cantidad in paneles.items()])
            descripcion_paneles_sug = " y ".join([f"{cantidad} paneles de {medida}" for medida, cantidad in paneles_sug.items()]) if paneles_sug else "No disponible"

            resultado = {
                'paneles': descripcion_paneles,
                'paneles_sug': descripcion_paneles_sug,
                'herraje': herraje,
            }
            resultado['rieles'] = calcular_rieles(paneles.get('46cm', 0), paneles.get('53cm', 0)) #se agrega la linea para calcular los rieles
            
            resultado['chicote'] = asignar_chicote(alto) #se agrega la linea para calcular los chicotes

            if 'herraje_2' in rango['resultado']:
                resultado['herraje_2'] = rango['resultado']['herraje_2']

            print("Combinación encontrada:", resultado)  # Para depuración
            return resultado

    print("No se encontró una combinación adecuada.")  # Para depuración
    return None  # Podría ser más útil retornar None o lanzar una excepción personalizada